import articles from "./hackerNoonArticles";

const Card = (props) => {
  // console.log("Author:", articles.Programming[0].author);
  // console.log(articles.Programming[0].titleText);
  // console.log(articles.Programming[0].titleLink);
  return (
    <div className="black">
      <div>
        <h3>{props.titleText}</h3>
        {props.titleText ? <div className="divider" /> : ""}
        {props.children}
        <p>{props.titleLink}</p>
        <div className="flex">
          <h3 className="margin-twenty">{props.author}</h3>
          <h4 className="margin-twenty">{props.userName}</h4>
        </div>
        <div className="flex">
          <h5 className="margin-twenty">{props.hashTag}</h5>
          <h5 className="margin-twenty">{props.readIn}</h5>
          <h6 className="margin-twenty">{props.posted}</h6>
        </div>
      </div>
    </div>
  );
};

const StoryTag = () => (
  <div className="black">
    <div className="">
      <h1>Programming</h1>
    </div>
  </div>
);

const StoryCardContent = () => (
  <div className="black">
    <StoryTag />
    <div className="wrapper">
      <Card
        // {for (let i=0; i < articles.Programming.length; i++){
        //   titleText={articles.Programming[i].titleText}
        // }}
        titleText={articles.Programming[0].titleText}
        titleLink={articles.Programming[0].titleLink}
        author={`Author: ${articles.Programming[0].author}`}
        userName={articles.Programming[0].userName}
        hashTag={articles.Programming[0].hashTag}
        readIn={articles.Programming[0].readIn}
        posted={`Posted: ${articles.Programming[0].posted}`}
      ></Card>
      <Card
        titleText={articles.Programming[1].titleText}
        titleLink={articles.Programming[1].titleLink}
        author={`Author: ${articles.Programming[1].author}`}
        userName={articles.Programming[1].userName}
        hashTag={articles.Programming[1].hashTag}
        readIn={articles.Programming[1].readIn}
        posted={`Posted: ${articles.Programming[1].posted}`}
      ></Card>
      <Card
        titleText={articles.Programming[2].titleText}
        titleLink={articles.Programming[2].titleLink}
        author={`Author: ${articles.Programming[2].author}`}
        userName={articles.Programming[2].userName}
        hashTag={articles.Programming[2].hashTag}
        readIn={articles.Programming[2].readIn}
        posted={`Posted: ${articles.Programming[2].posted}`}
      ></Card>
    </div>
  </div>
);

const BodyContent = () => (
  <div className="black">
    <StoryCardContent />
  </div>
);

export const Body = () => (
  <div className="center">
    <div className="cell inline">
    <StoryCardContent />
    </div>
  </div>
);
